import Home from "./pages/home/Home";
import './app.scss';
import Watch from "./pages/watch/Watch";
import Register from "./pages/register/Register";
import Login from "./pages/login/Login";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";

const App = () => {
  const user = true;
  // return <Login />
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          {user ? <Home /> : <Redirect to='/register' />}
        </Route>
        <Route path="/register">
          {!user ? <Register /> : <Redirect to='/' />}
        </Route>
        <Route path="/login">
          {!user ? <Login /> : <Redirect to='/' />}
        </Route>
        {}
        <Route path="/movies">
          <Home type='movies' />
        </Route>
        <Route path="/series">
          <Home type='series' />
        </Route>
        <Route path="/watch">
          <Watch />
        </Route>
      </Switch>
    </Router>
  )
};

export default App;
